import React from "react";

const Menu = () => {
  return (
    <nav className="navbar bg-dark">
      <ul className="navbar-nav">
        <li className="nav-item">
          <a className="nav-link" href="#">
            Link 1
          </a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">
            Link 2
          </a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">
            Link 3
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Menu;
